const ADD_SHARE = 'ADD_SHARE'

export const createShare = (payload) =>({
  type: ADD_SHARE,
  payload
})



export default function shareReducer (state, action){
  const newState = { ...state }

  switch(action.type) {
    case ADD_SHARE :
    return newState
    default: 
    return state
  }
}
